from utils import rna_codons

def rna_to_protain(rna: str) -> str:
    protain = ''
    for i in range(0, len(rna), 3):
        codon = rna[i:i+3]
        amino_acid = rna_codons.translation[codon]
        
        if amino_acid == 'Stop':
            break

        protain += amino_acid

    return protain

if __name__ == '__main__':
    dataset = ''
    result = rna_to_protain(dataset)
    print(result)